  'AdminDashboardHelp' => 
  array (
    'For the carrier named %s, indicate the domestic delivery costs  in percentage of the price charged to customers.' => 'Za %s dostavljača, ukazati na domaću cenu isporuke u procentima cene koju kupci naplaćuju.',
