  'AdminDesignHelp' => 
  array (
    'To add "tags" click in the field, write something, and then press "Enter."' => 'Da dodate "Tagove", kliknite u polje, napišite nešto i zatim pritisnite "Enter"',
    'Will appear on email headers. If undefined, the header logo will be used.' => 'Pojaviće se u e-mail zaglavlju, ako ostane nedefinisano koristiće sе logo zaglavlja.',
    'Will appear on invoice headers.' => 'Pojaviće se na zaglavlju računa.',
    'Warning: you can use a PNG file for transparency, but it can take up to 1 second per page for processing. Please consider using JPG instead.' => 'Upozorenje: možete koristiti PNG sliku za providnost, ali učitavanje može potrajati čak sekundu. Razmislite o korišćenju JPG slike.',
    'You must select a shop from the above list if you wish to choose a theme.' => 'Treba da izaberete prodavnicu sa gornje liste ako želite da izaberete šablon.',
    'JPEG images have a small file size and standard quality. PNG images have a larger file size, a higher quality and support transparency. Note that in all cases the image files will have the .jpg extension.' => 'JPEG slike imaju malu veličinu fajla i standardni kvalitet. PNG slike imaju veću veličinu fajla i bolji kvalitet i podrzavaju providnost. Zapamtite da u svim slučajevima fajlovi slika će imati .jpg ekstenziju',
    'WARNING: This feature may not be compatible with your theme, or with some of your modules. In particular, PNG mode is not compatible with the Watermark module. If you encounter any issues, turn it off by selecting "Use JPEG".' => 'UPOZORENJE: Ova odlika nije kompatibilna sa vašom temom ili sa nekim modulima. Konkretno, PNG režim nije kompatibilan sa modulom vodenog žiga. Ako naiđete na neki problem, isključite ga odabirom "Koristi JPG".',
    'Ranges from 0 (worst quality, smallest file) to 100 (best quality, biggest file).' => 'Opseg od 0 (najslabiji kvalitet, najmanji fajl) do 100 (najbolji kvalitet, najveći fajl)',
    'This should be set to yes unless you successfully moved images in "Images" page under the "Preferences" menu.' => 'Treba da bude postavljeno na "da" ukoliko niste uspešno preselili slike u "Slike" u meniju "Podešavanja".',
