    'You can also click the filename in the list below, and even make a multiple selection by keeping the Ctrl key pressed while clicking, or choose a whole range of filename by keeping the Shift key pressed while clicking.' => 'Takođe možete kliknuti na naziv fajla na listi ispod, ili čak odabrati višestruku selekciju držanjem dugmeta Ctrl u toku klikćanja, ili pak odaberete ceo rang naziva fajlova držanjem dugmeta Shift tokom klikćanja.',
    'Regenerates thumbnails for all existing images' => 'Ponovo napravi sličice za postojeće slike proizvoda',
