    'Number of customer accounts created' => 'Broj korisničkih naloga',
    'The total number of accounts created is not in itself important information. However, it is beneficial to analyze the number created over time. This will indicate whether or not things are on the right track. You feel me?' => 'Ukupan broj naloga sam po sebi nije važna informacija. Međutim, korisno je da se analizira promena tog broja vremenom. To je indikator da li se stvari odvijaju pravim tokom.',
