    'If you let your shop run without changing anything, the number of customer registrations should stay stable or show a slight decline.' => 'Ako dozvolite da vaša prodavnica radi bez ikakvih promena, broj registrovanih korisnika treba da ostane stabilan ili da pokazuje blagi pad.',
    'A significant increase or decrease in customer registration shows that there has probably been a change to your shop. With that in mind, we suggest that you identify the cause, correct the issue and get back in the business of making money!' => 'Značajno povećanje ili smanjenje registracije kupaca pokazuje da je verovatno bilo promena u vašoj prodavnici. Imajući to u vidu, predlažemo vam da pronađete uzrok, ispravite problem i vratite se u biznis da zarađujete novac!',
    'Here is a summary of what may affect the creation of customer accounts:' => 'Evo kratkog pregleda šta potencijalno utiče na pravljenje korisničkih naloga:',
    'An advertising campaign can attract an increased number of visitors to your online store. This will likely be followed by an increase in customer accounts and profit margins, which will depend on customer "quality." Well-targeted advertising is typically more effective than large-scale advertising... and it\'s cheaper too!' => 'Reklamna kampanja može privući veći broj posetilaca na vašu onlajn prodavnicu. Ona će verovatno biti praćena povećanjem naloga kupaca i profitne marže, što će zavisiti od "kvaliteta" kupaca. Dobro ciljno oglašavanje je obično efikasnije od velikih oglašavanja... a pritom i dosta jeftinije!',
    'Specials, sales, promotions and/or contests typically demand a shoppers\' attentions. Offering such things will not only keep your business lively, it will also increase traffic, build customer loyalty and genuinely change your current e-commerce philosophy.' => 'Specijalne ponude, promocije i/ili takmičenja uglavnom zahtevaju pažnju kupaca. Ponuda ovakvih stvari ne samo što će održavati bolji nivo poslovanja, već će i povećati saobraćaj, izgraditi lojalnost kupaca i i zaista promeniti vašu trenutnu filozofiju prodaje.',
